import react from "react"

import styles from "./Button.module.css"

const Button = (props) => {
    return(
        <button
        className={`${styles.button} ${props.className}`} 
        type={props.type}
        onClick={props.onClick}
        onSubmit={props.onSubmit}
        disabled={props.disabled}
        >
            {props.children}
        </button>
    )
}

export default Button
